import React from 'react'
import {
    Card,
    CardImg,
    CardBody,
    CardTitle,
    CardSubtitle,
    CardText,
    Button
}from 'reactstrap'
import posed from 'react-pose'

import './about.css'

const Box = posed.div({
    up: {y: -100},
    down : {y: 100}
})



class aboutUs extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            text : ""
        }
    }

    container(){
        return(
            <div id = 'aboutEvent'>
                        <Card>
                            <CardImg top width = '10%' src = "https://placeholdit.imgix.net/~text?txtsize=33&txt=318%C3%97180&w=318&h=180" alt="Card image cap1" />
                            <CardBody color>
                                <CardTitle>
                                    Card
                                </CardTitle>
                                <CardSubtitle>
                                    This is good
                                </CardSubtitle>
                                <CardText>
                                    This is some stuff yoo
                                </CardText>
                                <Button> Click me</Button>
                            </CardBody>
                        </Card>
                    </div>
        )
    }
    render(){
        return(
            <div id = 'content'>
                {this.container()}
            </div>
        );
    }
}

export default aboutUs
